 id="imageUploadmlaboutt1theme1" accept=".png, .jpg, .jpeg" data-cke-editable="1" contenteditable="false"> <label for="imageUploadmlaboutt1theme1" class="imageUploadmlaboutt1theme1" style="display: none;">&nbsp;</label> <img id="imagePreviewmlaboutt1theme1" data-cke-saved-src="<?php echo url('/'); ?>/files/11/nm.jpg" src="<?php echo url('/'); ?>/files/11/nm.jpg" alt="It's Me" style="width: 180px; height: 180px;">​</div></div><div class="row-fluid"><div class="col-lg-12 col-md-12 col-sm-12 col-xs-12"><div class="about-text"><div class="boxmlaboutt1theme2 textmlaboutt1theme2"><span contenteditable="false" class="editmlaboutt1theme2" style="display: none;">edit</span> <span contenteditable="false" class="savemlaboutt1theme2">save</span><h2><br></h2><section id="ref1" data-level="1"><p>Narendra Modi, in full&nbsp;Narendra Damodardas Modi, (born September 17, 1950, Vadnagar, India), Indian politician and government official who rose to become a senior leader of the&nbsp;Bharatiya Janata Party&nbsp;(BJP). In 2014 he led his party to victory in elections to the&nbsp;Lok Sabha&nbsp;(lower chamber of the Indian parliament), after which he was sworn in as&nbsp;prime minister&nbsp;of&nbsp;India. Prior to that he had served (2001–14) as chief minister (head of government) of&nbsp;Gujarat&nbsp;state in western India.Modi was raised in a small town in northern Gujarat, and he completed an M.A. degree in&nbsp;political science&nbsp;from Gujarat University in&nbsp;Ahmadabad. He joined the pro-Hindu&nbsp;Rashtriya Swayamsevak Sangh(RSS) organization in the early 1970s and set up a unit of the RSS’s students’ wing, the Akhil Bharatiya Vidyarthi Parishad, in his area. Modi rose steadily in the RSS&nbsp;hierarchy.</p></section></div></div></div></div></div></div></section></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class=